import React, { useEffect, useState } from "react";

function App() {
    const [dataBackend, setDataBackend] = useState({});

    useEffect(() => {
        fetch("/api")
            .then((res) => res.json())
            .then((data) => setDataBackend(data));
    }, []);

    return <div className="App"></div>;
}

export default App;


